const quiz = [
  {
    question:
      "How many unbroken double unders can the most proficient athlete in your team do?",
    answers: [
      {
        txt: "50+",
        value: "ludicrous",
      },
      {
        txt: "20-50",
        value: "ludicrous",
      },
      {
        txt: "10-20",
        value: "spicy",
      },
      {
        txt: "1-5",
        value: "spicy",
      },
      {
        txt: "I can't do Double Unders. Only Single Unders for me",
        value: "fun",
      },
    ],
  },
];

module.exports = {
  quiz,
};
